import { Routes, Route } from "react-router-dom";
import NotFoundPage from "./pages/NotFoundPage";
import StartingPage from "./pages/StartingPage";

function App() {
  return (
    <Routes>
      <Route path="/" element={<StartingPage />} />
      <Route path="*" element={<NotFoundPage />} />
    </Routes>
  );
}

export default App;
